import { TextField } from "@mui/material";
import { RedButton } from "../../../components/Button/Button";
import { useState } from "react";

const SellerOrder = () => {
  const [trackingNumber, setTrackingNumber] = useState<string>("");

  return (
    <div className="flex flex-col w-full px-16 py-8 gap-4">
      <div className="flex flex-col gap-2 mb-4">
        <div className="text-2xl font-bold">물품조회</div>
        <div className="text-sm text-gray-500">
          구매하신 물품은 운송장번호로 조회 가능합니다. <br /> 운송장번호를
          입력해주세요
        </div>
      </div>
      <div className="flex w-full">
        <div className="w-2/3">
          <div>운송장번호</div>
          <TextField
            id="trackingNumber"
            label="운송장번호를 입력해주세요"
            variant="standard"
            onChange={(e) => setTrackingNumber(e.target.value)}
            style={{ width: "80%" }}
          />
        </div>
      </div>
      <RedButton buttonText="주문한 물품 조회" />
    </div>
  );
};
export default SellerOrder;
